          "iterazione": " un periodo di tempo fisso, in genere dalle 2 alle 4 settimane, in cui si svolgono tutte le fasi di sviluppo del software nelle metodologie agili. In Scrum literazione  chiamata :sprint: ",
          "manifesto agile": " un documento redatto nel 2001 da 17 sviluppatori con lintento di definire i valori e i principi dello sviluppo agile di software",
          "metodologie a cascata": "Sono un insieme di metodi di sviluppo software e progetti caratterizzato da una sequenza lineare di fasi ben distinte (esempio: analisi, sviluppo, test, rilascio).",
          "metodologie agili": " un insieme di metodi di sviluppo software e progetti che si distingue dai metodi tradizionali per lapproccio iterativo e incrementale.",
          "product backlog": "Vedi :backlog:",
          "product owner": " il responsabile per la priorizzazione del Product Backlog e del ritorno dellinvestimento. Il Product Owner (abbreviato con PO)  lunico responsabile per il valore del lavoro svolto dal team",
          "scrum": " una metodologia di sviluppo agile per lo sviluppo di software, applicazioni e progetti, basata su iterazioni fisse chiamate :sprint:",
          "scrum master": "Aiuta il team a essere efficace e a raggiungere gli obiettivi. Lo Scrum Master (abbreviato con SM)  una figura chiave nel facilitare il Team a risolvere gli impedimenti e a proteggerlo da rumori esterni",
          "sprint": "Vedi :iterazione:",
          "sprint backlog": "Vedi :backlog:",
          "sviluppo agile": "Sviluppo di software, applicativi o progetti, basato sui principi del :manifesto agile:",
          "story point": " lunit di misura dell:effort: di ciascuna :user story:. Abbreviato: SP.",
          "team": "Il team in Scrum  composto da :Product Owner:, :Scrum Master: e :team_di_sviluppo:.",
          "team di sviluppo": "Linsieme di progettisti, analisti e sviluppatori software che lavorano a un progetto.",
          "user story": "Le user story sono una definizione ad alto livello dei requisiti che compongono un prodotto. Sono scritte dal punto di vista di chi richiede una :feature:.",
          "velocity": " lunit di misura che consente di tenere traccia di quanto lavoro pu svolgere il :team di sviluppo: durante un:iterazione:.",
          "UX Design": "Lo User experience design (UXD o UED), in italiano: progettazione dell'esperienza utente  il processo volto ad aumentare la soddisfazione e la fedelt del cliente migliorando l'usabilit, la facilit d'uso e il piacere fornito nell'interazione tra il cliente e il prodotto. La progettazione dell'esperienza utente comprende la tradizionale progettazione interazione uomo-macchina e la estende indirizzandosi a tutti gli aspetti del prodotto o del servizio come percepito dagli utenti. L'esperienza utente  qualsiasi aspetto di un'interazione della persona con un dato sistema IT, includendo l'interfaccia, la grafica, la progettazione industriale, l'interazione fisica e manuale.",
          "feature": "Si tratta delle caratteristiche uniche di un prodotto o servizio. dispositivo, attrezzatura, funzione.  Caratteristiche, distinzioni. Cos vengono definite le nuove caratteristiche (feature) di un programma.",
          "BDD": "behavior-driven development (abbreviato in BDD)  il behavior-driven development (abbreviato in BDD e traducibile in Sviluppo guidato dal comportamento)  una metodologia di sviluppo del software basata sul test-driven development (TDD) Il BDD combina le tecniche generali e i principi del TDD, con idee prese dal domain-driven design e dal design orientato agli oggetti, per fornire agli sviluppatori software e ai Business analysts degli strumenti e un processo condivisi per collaborare nello sviluppo software. Per quanto BDD sia principalmente un'idea di come lo sviluppo del software dovrebbe essere gestito sia da interessi di business e analisi tecniche, la pratica della BDD assume l'utilizzo di strumenti software specializzati per supportare il processo di sviluppo. Sebbene questi strumenti siano spesso sviluppati in particolare per essere utilizzati in progetti BDD, possono essere visti anche come delle forme specializzate degli strumenti che supportano la TDD. Gli strumenti servono per aggiungere automazione all'ubiquitous language che  il tema centrale della BDD."
